import { defineStore } from "pinia";
import { setCssVar, Dark } from "quasar";
import { Theme } from "../types/types";

export const useThemeStore = defineStore("theme", {
  persist: true,
  state: () => ({
    activeThemeIndex: 0,
    themes: [
      {
        name: "Light",
        colors: {
          primary: "#e68702",
          secondary: "#5983a0",
          accent: "#9C27B0",
          dark: "#1D1D1D",
          positive: "#21BA45",
          negative: "#C10015",
          info: "#5978a0",
          warning: "#F2C037",
        },
        darkMode: false,
      },
      {
        name: "Dark",
        colors: {
          primary: "#e68702",
          secondary: "#5983a0",
          accent: "#9C27B0",
          dark: "#1D1D1D",
          positive: "#21BA45",
          negative: "#C10015",
          info: "#5978a0",
          warning: "#F2C037",
        },
        darkMode: true,
        backgroundColor: "#1D1D1D",
      },
      {
        name: "Cat",
        colors: {
          primary: "#e68702",
          secondary: "#5983a0",
          accent: "#9C27B0",
          dark: "#1D1D1D",
          positive: "#21BA45",
          negative: "#C10015",
          info: "#5978a0",
          warning: "#F2C037",
        },
        darkMode: false,
        backgroundImageBase64:
          "data:image/png;base64,",
      },
    ] as Theme[],
  }),
  getters: {
    activeTheme: (state) => state.themes[state.activeThemeIndex] as Theme,
    activeThemeLayoutStyle() {
      if (this.activeTheme.backgroundImageBase64) {
        return {
          backgroundImage: `url(${this.activeTheme.backgroundImageBase64})`,
          backgroundRepeat: "repeat",
        };
      } else if (this.activeTheme.backgroundColor) {
        return {
          backgroundColor: this.activeTheme.backgroundColor,
        };
      } else {
        return {};
      }
    },
    themeNames: (state) => state.themes.map((t) => t.name),
  },
  actions: {
    set(name: string) {
      this.activeThemeIndex = this.themes.findIndex((t) => t.name === name);
      this.applyActiveTheme();
    },
    applyActiveTheme() {
      // Apply colors
      if (this.activeTheme.colors) {
        Object.entries(this.activeTheme.colors).forEach(([key, value]) => {
          setCssVar(key, value);
        });
      }

      // Apply quasar 'dark mode'
      Dark.set(this.activeTheme.darkMode);
    },
  },
});
